import React from 'react'
import './Searches.css'

const workers = [
    {names: "Leonard Kombo",
     image:"https://dlisted.com/wp-content/uploads/2018/11/idrissexyiestman2018.jpg" ,
     jobtitle:"Plumber",
     detail:"Hard working 5ys experience in the field",
     rating:"4.5"
     },
     {names: "Leonard Kombo",
     image:"https://www.asplumbingcompany.com/images/home/as%20plumber%20smiling-1@2x.png",
     jobtitle:"Plumber",
     detail:"Hard working 5ys experience in the field",
     rating:"4.5"
     },
];

function Searches() {
  return (
    <div className='searches'>
       <h1>I am a Searches page</h1> 
       {workers.map((worker,index)=>(
        <div key={index} >  {worker.names} <img src={worker.image} alt=''/> {worker.jobtitle} {worker.detail} {worker.rating} </div>
          ))}
    </div>
  )
}

export default Searches
